import React from 'react';
import ReactDOM from 'react-dom';

import {
    Title
} from './components';

const App = () => {
    return (
        <div id='app'>
            <Title />
        </div>
    );
}

ReactDOM.render(
    <App />,
    document.getElementById('root')
);
